- input: "TEXT\x1CC00044842\x1C.TEXT\x1C\x1CF3XA\x1CPayments for Net Salary were made
    for staff members spending less than 25% of their time on FEA or any activities
    in connection with a federal election.  Amy Petraglia and Jo Carey Dunn were hired
    to do generic party fundraising for the state party organizaton.  The Rep. State
    Cmte of PA does not fund-raise for specific candidates.  Payments for 'General
    Party Signage' reported in Schedule B supporting Line 21(b) to Sign A Rama were
    Republican Party of Pa Logo signs and did not identify any candidates.  The Transfer
    in from the RNC reported in Schedule A supporting Line 12 is for Party Building
    Efforts and was not used as payment for the General Party Signage referred to
    above.  Reimibursed expenses to Damon Kegerise in Schedule H4 were amended to
    reflect the correct itemization.  Refunds from Comcast Cable Communications and
    Susquehanna Patriot Leasing disclosed in Schedule A supporting Line 15 were allocable
    expenses.  The refund for each has been allocated between the federal and non-federal
    account according to the same ratio (72-28) and a transfer was made from the Federal
    to the Non Federal Account  in the amount of $330.22 on Aug. 20, 2008.  The transfer
    will be reported in our September Monthly Report.  Totals listed on Lines 11(a)(ii),
    Column B have been corrected and addresses have been updated."
